import AssetActionTypes from './asset.types';

const INITIAL_STATE = {
    asset: null,
    test: []
}



const firstAsset = async () => {
    const res = await fetch('https://localhost:3000/WT');
    const dataArray = await res.json();

    return dataArray
}


const assetReducer = (state = INITIAL_STATE, action) => {
    switch(action.type){
        case AssetActionTypes.WT_ASSET:
            return {
                asset: firstAsset(),
                ...state
            };

        default:
            return state;
    }
}

export default assetReducer;
